(24, 'data:image/jpeg;base64,', 'Маргарита Тараненко и Ольга Доленко – лучшие инструкторы по спорту', '15 сентября в конгресс-холле Сибирского Федерального университета в г. Красноярске прошло торжественное награждение победителей и призеров конкурса на лучшую постановку физкультурно-массовой работы на территории Красноярского края. В номинации «Физкультурно-спортивные клубы по месту жительства муниципальных образований Красноярского края с численностью сельского населения не менее 80%» стали победителями наши инструкторы по спорту.\r\n                <br>\r\n                <br>Первое место заняла Маргарита Тараненко, инструктор по спорту физкультурно-спортивного клуба Сотниково «Юность» спортшколы\r\n                <br>\r\n                <br>«Олимпиец». Третье место у Ольги Доленко, инструктора по спорту физкультурно-спортивного клуба Филимоново «Звездный» спортшколы «Олимпиец».', '#КанскийГТО #ЗОЖ #СпортНормаЖизни');
INSERT INTO `news` (`id`, `imgPath`, `title`, `text`, `tags`) VALUES
(25, 'data:image/jpeg;base64,', 'В спортшколе «Олимпиец» подвели итоги спартакиады на кубок главы Канского района', 'В течение года соревнования проводились по десяти видам спорта: волейбол, армрестлинг, полиатлон, мини-футбол, гиревой спорт, настольный теннис, дартс, шахматы, легкая атлетика, соревнование спортивных\r\n            семей.\r\n            <br>\r\n            <br>По итогам спартакиады обладателем кубка главы Канского района в 2023 году стала команда из Чечеула. Второе место у команды браженцев, третье – у Филимоново. Глава Канского района Александр Заруцкий вручил кубок победителям.', '#КанскийГТО');
